import React from 'react';
import { element } from 'prop-types';
import Header from './layout/Header/Header';
import Content from './layout/Content/Content';
import Footer from './layout/Footer/Footer';
import './App.css';

const App = props => (
  <div className="App">
    <Header title="Cyber Mart" />

<Content>
  {props.children}
</Content>

<Footer />
  </div>
);

App.propTypes = {
  children: element
};

export default App;
